import React from "react";
import Main from "./components/Main";
import Header from "./components/Header";
import Footer from "./components/footer";
let cars = [
  {
    model: "Mers",
    price: 560000,
    amout: 3,
  },

  {
    model: "Bmw",
    price: 7600000,
    amout: 2,
  },
  {
    model: "Priora",
    price: 1560000,
    amout: 1,
  },
  {
    model: "Camry",
    price: 5100000,
    amout: 19,
  },
  {
    model: "Zeekr001",
    price: 5600000,
    amout: 10,
  },
];
function App() {
  let carsPrice = cars.filter((car) => {
    return car.price >= 5000000;
  });

  return (
    <>
      <div className="container number ">
        {carsPrice.map((car) => {
          return (
            <div className="flex">
              <p>{car.model}</p>
              <p>{car.price}</p>
              <p>,{car.amout}</p>
            </div>
          );
        })}
      </div>
    </>
  );
}
export default App;
